INSERT INTO `bbs_question` (`id`, `month`, `title`, `knowledge`, `section1`, `section2`, `section3`, `section4`, `explain_title`, `explain_link`, `explain3`, `explain4`, `answer`, `pic`, `sort`, `addtime`) VALUES
	(72, 9, '8月14日，福田区社会建设专项资金管理领导小组办公室发布公告称，本期福田区社会建设专项资金资助项目申报开始啦！请问一个项目最高可申请多少钱？', '本期福田区社会建设专项资金项目资助总预算1500万元，具体资金分配根据项目申报和评审结果决定。专项资金用于项目资助的额度，原则上每个项目不超过100万元。      ', '50万元', '100万元', '150万元', '200万元', '最高可申请100万元资助！福田区社会建设专项资金资助项目申报开始啦！', 'https://mp.weixin.qq.com/s?src=11&timestamp=1504236233&ver=365&signature=i2OCOAYfDWJv1Z5Jk7B6fiSSr6e4etc5GsuJNck8bcPFjMKK3FJVD3i1c-I-VJOczYIvto4aYEdTvr-SQFjcG5VVTfqImoddaB*7ihS*V3piylXSZ*fCWJGPo8NTjWiB&new=1', '', '', 2, '/upload/2017/09/01/a5216dda8c167aab734297090461a2eb.png', 1, 1504236421),
	(73, 9, '2、8月8日，福田区国家税务局▁▁正式上线，纳税人不仅可以各个角度浏览大厅食物结构、区域、内容，还可以导航动态体验业务的全部办理流程。', ' 8月8日，“深圳福田国税”微信公众号作了一次全新的推送，福田区国税局耗时两个月打造的全国首个可交互智慧办税大厅正式上线，这是深圳市福田区国税局打造的崭新便民项目，将真实的办税大厅动态化地呈现在屏幕中。  ', 'VR电子税务大厅', '微信公众号', '新浪微博', '网站', '深圳出入境在线业务办理地址有重大调整 、学车最快3个月可领驾照？...周一，读我就够了！|民生快报', 'http://mp.weixin.qq.com/s?__biz=MzA3NTA1NzIxNA==&mid=2651606645&idx=1&sn=85840fac68fa4a4378120732284f5ec0&chksm=848ebf24b3f93632608916da8fdcfeb3f46b358388a34488f16a7fc7ddda02ab15ffb2e99c22&mpshare=1&scene=23&srcid=0901n9sGfrMMqjWlQTVn8vJ8#rd', '', '', 1, '/upload/2017/09/01/c5eec0586a7ceb9a9c2db26b431a3c41.png', 1, 1504236989),
	(74, 9, '8月24日，华强北升级为“▁▁”', ' 8月24日上午，华强北荣获“中国著名商业街”授牌仪式在华强北街道文化站隆重举行。ABC 3个选项的荣誉之前华强北就已经获得了。 ', '全国双创基地', '国际信誉品牌', '中国电子第一街', '中国著名商业街', '历经30载成为中国著名商业街，华强北是这样做的……', 'https://mp.weixin.qq.com/s?timestamp=1504233931&src=3&ver=1&signature=FsBb8KLMggnTqcLSgxXddl*c9b3FtIqzyJdTrcr7dPeDIrfKStEnfoZdc6l04fEksqe5Uo5n8oz8qpLY8onMTEoQx*lg6RgWzegPCQydSLnLUX9V*Bp8jAg2lYGk8m7Rd*uMGPr6keDbTiBmt-LIwWsllmAZ-iASUrSE4Qi-ZfE=', '', '', 4, '/upload/2017/09/01/164b451347bc0da7061cc8a0c99a86c2.png', 1, 1504234020),
	(75, 9, '在皇岗村内，有着深圳市内唯一具有苏州园林建筑特色风格的公园，这座公园叫什么名字？', '   锦绣园占地面积约2万平方米。园内有古树，且树木成荫、古亭假山小桥流水，景色怡人。园内建筑以古建亭台楼阁为主， 深圳市内唯一\n具有苏州园林建筑特色风格的公园  ', '锦绣园', '回雁公园', '同心南公园', '园岭公园', '“苏州园林”在深圳福田，这是真的！', 'https://mp.weixin.qq.com/s?timestamp=1504233712&src=3&ver=1&signature=FsBb8KLMggnTqcLSgxXddiefeFNITgF2B*HIWU3p9bvZxWhaOdP3Eh-cex0kk6*OQA5aS28P8Ol7IHqNOGO0xCeh5ArQ18dnzzaDfjqesc4c*Q*sl-4ZFiQrHRqqF4tAaYxrhDskmVGLi*QAd42-bznoU4NNusPhbsANdyzDhtE=', '', '', 1, '/upload/2017/09/01/d64beb1d6d5f71790c852bc491ccaf1c.png', 1, 1504233909),
	(76, 9, '8月25日，福田区召开七届四次全会会。会议上， 肖亚非要求，福田当务之急就是按照市委全会的各项部署要求，转变作风、抢抓机遇、大干快上、争先竞位，要着力做好▁▁▁▁▁▁', '福田区七届四次全会上， 肖亚非要求，作为中心城区，福田当务之急就是按照市委全会的各项部署要求，转变作风、抢抓机遇、大干快上、争先竞位，要着力做好“五个抓”：抓机遇、抓攻坚、抓效率、抓质量、抓基层。 ', '“八个着力”', '“五个着力”', '“五个抓”', '“八个抓”', '福田区召开区委全会：抢抓机遇，争先竞位，勇当率先建设社会主义现代化先行区的尖兵', 'https://mp.weixin.qq.com/s?timestamp=1504233931&src=3&ver=1&signature=FsBb8KLMggnTqcLSgxXddl*c9b3FtIqzyJdTrcr7dPeDIrfKStEnfoZdc6l04fEksqe5Uo5n8oz8qpLY8onMTL65IbzmJ6WwVhHU5oSTZ36Z3iyPReyhxefuChuubcF05LzUgsn-BFlhgQu3CweOu0pDxII4rjfV4BpzsmLh19g=', '', '', 3, '/upload/2017/09/01/9a7ea170f0a78655b87652961370962d.png', 1, 1504233977),
	(77, 9, '深圳户政业务不求人，拨打一个电话号码全部搞定！请问是哪一个？', '  0755-84465000是深圳市公安局户政咨询中心电话，只要记住这个号，一切户政咨询都搞定 ', '84465000', '84465001', '84465002', '84465003', '深圳3趟高铁可直达佛山 、所有户政业务咨询一个电话搞定？...周一，读我就够了！|民生快报', 'https://mp.weixin.qq.com/s?timestamp=1504233931&src=3&ver=1&signature=FsBb8KLMggnTqcLSgxXddl*c9b3FtIqzyJdTrcr7dPeDIrfKStEnfoZdc6l04fEksqe5Uo5n8oz8qpLY8onMTNcpuXlWjzxEwAdgdgotUJrL4f7SJZd8QhMeajxolzWFdBl4n8dCowzY4s9AQliBN8zoRXXP7OseTtLQNwo*Uk4=', '', '', 1, '/upload/2017/09/01/eaa7eda7f184dc8c8a5bac152d69bf50.png', 1, 1504234266),
	(78, 9, ' 8月18日，深圳市福田区与香港生产力促进局成立“香港生产力促进局深圳创新及技术中心”合作备忘录签约仪式正式举行。此次签约是福田区政府最新打造的“深港协同创新中心”落户的▁▁▁▁港方科研机构项目。', ' “香港生产力促进局深圳创新及技术中心”是福田区政府最新打造的“深港协同创新中心”落户的首个港方科研机构项目。此次签约，标志着双方建立了稳固的战略合作伙伴关系，也为该区域未来的发展奠定了坚实基础。  ', '第一个', '第二个', '第三个', '第四个', '福田打造首个港方科研机构项目！TA就是—「香港生产力促进局深圳创新及技术中心」', 'https://mp.weixin.qq.com/s?src=11&timestamp=1504234959&ver=365&signature=i2OCOAYfDWJv1Z5Jk7B6fiSSr6e4etc5GsuJNck8bcOWNBqLDyc6m-jlfaRJJTrRWAPuhJ5dxQXwjaUwuA497mUXYYrNLCQW2ipPafKWu0olVQCsEd-V0XhNKq9wwte4&new=1', '', '', 1, '/upload/2017/09/01/16f498b7f8ea6f34a6e4e9c55a8d1fd6.png', 1, 1504237037),
	(79, 9, '8、怎么找一份合适的工作？创业又该去哪里找平台？8月15日下午，园岭街道“两中心”正式揭牌，将为居民提供就业培训、就业指导、创业培训、创业寻址等服务。“两中心”指的是▁▁▁▁▁', '  8月15日下午，园岭街道“就业创业服务中心”和“职业训练中心”正式揭牌。就业创业服务中心更下设三个不同部门为有意就业的居民提供服务   ', '“就业中心”和“创业中心”', '“就业创业服务中心”和“职业训练中心”', '“就业培训中心”和“创业培训中心”', '“就业指导”和“创业寻址中心”', '一条龙服务，坐标福田？！嘿嘿别想歪，说的是为就业创业提供一条龙服务呢~ ', 'http://mp.weixin.qq.com/s?__biz=MzA3NTA1NzIxNA==&mid=2651606668&idx=2&sn=f9a8b7bb4a5b0cbcc68439a56cdcd0eb&chksm=848ebfddb3f936cb2bc0d970e580d28e2a4ad6a8cf2248367055db3bec47f2dad478e91e2b75&mpshare=1&scene=23&srcid=0901p6x0lYCd4MPAzqdP1xWu#rd', '', '', 2, '/upload/2017/09/01/f6621a345d8eafd4d751db57e22c878c.png', 1, 1504236858),
	(80, 9, '今年七夕（8月28日）福田教育又有大动作，与深圳哪个区举行教育合作签约仪式，这一合作也开创了深圳教育“区际联动、合作共赢”的行动先河！', ' 8月28日上午，福田区人民政府和大鹏新区管理委员会举行教育合作签约仪式。双方本着“跨区联动、优势互补、资源整合、共谋发展”的原则，在共同推进教育事业发展上达成合作协议，标志着福田区与大鹏新区的教育战略合作正式落地，这一合作也开创了深圳教育“区际联动、合作共赢”的行动先河。    ', '光明新区', '罗湖区', '盐田区', '大鹏新区', '福田教育又有大动作！ 七夕与大鹏“联姻”，是要干嘛？', 'https://mp.weixin.qq.com/s?timestamp=1504233659&src=3&ver=1&signature=FsBb8KLMggnTqcLSgxXddqsBgZQd3WY7V7S4YG5TloUHZKQA*B5TzQlf1TMZprVSjxc56mGXITHkTTYZUCTj03rYcf-kXrxBYV9Rl2SJdhYsKsT-HGx-qgQn2jRyD3wsRHC74JS3zMsQpBvgdmU4sB-l985qzfr2yYQvPH6pKr0=', '', '', 4, '/upload/2017/09/01/edd3bd35f1956011cd5ffca35b9bcf4d.png', 1, 1504237074),
	(81, 9, '8月28日下午，深圳市福田区人民政府与哪个大学签约战略合作协议，为深港大河套再添“战斗机”!', '8月28日下午，深圳市福田区人民政府与南方科技大学签约战略合作协议，双方将在科技合作、教育合作、人才合作、智库与孵化合作等方面开展全面合作。南方科技大学正式成为国内第一家进驻河套地区的高端科技机构。 ', '中山大学', '南方科技大学', '深圳大学', '华南理工大学', '福田+南方科技大学，强强联合将有什么变化？', 'https://mp.weixin.qq.com/s?timestamp=1504233712&src=3&ver=1&signature=FsBb8KLMggnTqcLSgxXddiefeFNITgF2B*HIWU3p9bvZxWhaOdP3Eh-cex0kk6*OQA5aS28P8Ol7IHqNOGO0xGmgpqNbsdjEU7UaO*0aVAdwaaGxHo3xhyycHYUAz68ppf*efc8RX8feQ4NRiVhh4Wb0iSMp5cj2och9N1UMC9g=', '', '', 2, '/upload/2017/09/01/1c815ea7fc6916e32282cc574111d447.png', 1, 1504233819);
