	(1, 9, '文明养犬', '美丽坪山城市管理主题月月更新，每期都有丰厚的礼品送出。你养犬了吗？你知道文明养犬的知识吗？完成答题并留下联系方式，就能参加大转盘抽奖，获得话费、流量、电影票等奖品。  ', 1505719568);
